import Color from 'color';
import { blue500, red500, white, black } from '../colors';

import spacing from '../spacing';
import typography from '../typography';

export default {
  spacing,
  typography,
  iconSet: 'MaterialIcons',
  fontFamily: 'Roboto',
  palette: {
    // main theme colors
    primaryColor: blue500,
    accentColor: red500,
    // text color palette
    primaryTextColor: Color(black)
      .alpha(0.87)
      .toString(),
    secondaryTextColor: Color(black)
      .alpha(0.54)
      .toString(),
    alternateTextColor: white,
    // backgournds and borders
    canvasColor: white,
    borderColor: Color(black)
      .alpha(0.12)
      .toString(),
    // https://material.google.com/style/color.html#color-text-background-colors
    disabledColor: Color(black)
      .alpha(0.38)
      .toString(),
    disabledTextColor: Color(black)
      .alpha(0.26)
      .toString(),
    activeIcon: Color(black)
      .alpha(0.54)
      .toString(),
    inactiveIcon: Color(black)
      .alpha(0.38)
      .toString(),
    // pickerHeaderColor: cyan500,
    // clockCircleColor: faintBlack,
    // shadowColor: fullBlack,
  },
};
